import React from 'react';
import {Box, Input, Stack} from "@chakra-ui/react";

const Home = () => {
    return (
        <Box bg={'#F7FAFC'} minHeight={'100vh'}>
            <Box>
                <Stack maxW={'400px'} bg={'white'}>
                    <Input placeholder={'Enter a join code'}/>
                </Stack>
            </Box>
        </Box>
    );
};

export default Home;
